  \"A Unified Nonlinear Adaptive Approach for Detection and Isolation of Engine Sensor,
  Actuator and Component Faults Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T00:55:34.406495\",\n\t\"name\": \"a-unified-nonlinear-adaptive-approach-for-detection-and-isolation-of-engine-sensor-actuato\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Impact Technologies in collaboration with
  Pratt &amp; Whitney and Wright State University, proposes to continue the development
  of an innovative nonlinear adaptive method for detecting and isolating sensor faults,
  actuator faults, and component faults for jet engines. In sharp contrast to many
  conventional methods which deal with either sensor faults or component faults but
  not both, our method considers all three types of faults under one unified framework.
  In the successful Phase I program, we have demonstrated the effectiveness of the
  approach via a proof-of-concept demonstration using NASA's C-MAPSS model. The objective
  of Phase II is to raise the TRL by comprehensive development/improvement of the
  prototype system, extensive performance evaluation, and close collaboration with
  Pratt &amp; Whitney for technology transition. The success of this program will
  bring significant benefits to the propulsion industry by providing a cutting-edge
  engine diagnostics system with features that have never been available, including
  adaptive nonlinear engine model, adaptive threshold, transferrable-belief-model-based
  residual evaluation within a unified framework. These novel technologies will greatly
  improve performance of onboard engine diagnostics system especially during transient
  operations and further reduce false alarm rate and missed detection rate, resulting
  in improved flight safety and significant reduction in overall engine maintenance
  cost.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
